import React from "react";
import {
    Card, CardImg, CardText, CardBody,
    CardTitle, CardSubtitle, Button, Container
  } from 'reactstrap';


const AllCourses = () => {
    return (
        <Card>
        <CardBody>
          <CardSubtitle  className="font-weight-bold">Java</CardSubtitle>
          <CardText>This is Abaut Java Programming Language ddsadsamds </CardText>
         <Container>
         <Button color="danger">Delete</Button>
          <Button color="warning ml-2">Update</Button>
         </Container>

        </CardBody>
        </Card>
    )
}



export default AllCourses;
